import { Link } from 'react-router-dom';
import { data } from '../../mock/dummyData';
import './Lajme.scss';

 function UsersList() {
    const [users, setUsers] = useState(data);

   
  return (
    <div>
        {users.map(user => (
            <Link to={'user/' + user.id} >
                  <div className='all-foto'>
    <div>
        <div className='header'>
            {/* <img src={foto2} alt="Logo" /> */}
            <p>{user.title}</p>
        </div>
        <div className='container'>
            <div className='container-foto'>
            {/* <img src={foto3} alt="Logo" /> */}
            <p>{user.title}</p>
            </div >
            <div className='container-foto'>
            {/* <img src={foto4} alt="Logo" /> */}
            <p>{user.title}</p>
            </div>
            <div className='container-foto'>
            {/* <img src={foto5} alt="Logo" /> */}
            <p>{user.title}</p>
            </div>
        </div>
    </div>
    <div>
    <div className='header-right'>
            <h1>
                Bote
            </h1>
            <div className='header-right-foto'>
            {/* <img src={foto} alt="Logo" /> */}
            <p>{user.title}</p>
            </div >
            <div className='header-right-foto'>
            {/* <img src={foto} alt="Logo" /> */}
            <p>{user.title}</p>
            </div>
            <div className='header-right-foto'>
            {/* <img src={foto} alt="Logo" /> */}
            <p>{user.title}</p>
            </div>
        </div>
    </div>
    </div>
            </Link>
        ))}
    </div>
  )
}

export default UsersList;
